                            <div id="flowers">

                            </div>
                        </div>
                        <br aria-hidden="true"/>
                        <h1>Planned Work Time: <span className="streaks">{this.props.time} Hours <span role="img" aria-label="fire emoji">ðŸ”¥</span></span></h1>
                    </section>
